import React from 'react';




const Card = ({ info } ) => {
    console.log('url is ', info.url )
    return(
        <div className='tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
            <div>
                <h2>{info.name}</h2>
                <img id='inputimage' alt='image' src='https://scontent-ams3-1.cdninstagram.com/vp/bf242564661e4b13eaaac0334125d4fd/5CF72863/t51.2885-15/sh0.08/e35/s640x640/36653892_2129040784020979_4723576994594291712_n.jpg?_nc_ht=scontent-ams3-1.cdninstagram.com' width='500px' height='auto'/>
                <p>住所：{info.location}</p>
                <p>星：{info.rate}</p>
                <p>コメント：{info.comments}</p>
            </div>
        </div>
    );
}

export default Card;
